import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  title: { paddingVertical: 5 },
  itemListContainer: {
    marginLeft: -8,
    marginRight: -8,
    flexWrap: 'wrap',
  },
  container: {
    flex: 1,
    paddingHorizontal: 6,
  },
});

export default styles;
